import { makeStyles } from "@material-ui/core/styles";

export const useStyles = makeStyles(() => ({
	root: { display: "flex", flexDirection: "row", paddingLeft: "20px" },
	gridItem: { boxShadow: "2px 2px 8px rgba(0,0,0,0.5)", margin: "20px" },
}));
